import './App.css';

import Header from './components/header';
import AddTimeTable from './components/AddTimeTable';

import {BrowserRouter as Routes,Route} from "react-router-dom"



function App() {


  return (
    <BrowserRouter>
  <Routes>
    <div>
         <Header/>






    <Route path="/create" exact component={<AddTimeTable/>}/>

    </div>

  </Routes>
  </BrowserRouter>
















  );
}


export default App;
